    "2015-05-06T21:49:17.144055",nt"name": "pulsed-power-amplifier-for-enhanced-transmitter-power-output-in-l-and-p-band-t-r-modules-2",nt"isopen":
    true,nt"url": null,nt"notes": "For active microwave surveillance of earth
    surface and atmosphere, radar transceivers perform functions of probing the atmosphere
    and the surface conditions of the earth. The primary objective of Phase 1 is to
    establish a design baseline for a high-efficiency pulsed power amplifier MMIC/module
    operating at L-band frequency. Hittite has been working on development of L-band
    MMICs for all those functions and integration of the entire T/R module using an
    E/D PHEMT process. The transmitter power output of the current program is limited
    to about 2 watts. In Phase 2, the program objective should be expanded to include
    integration of the complete T/R module using the process compatible with the GaN
    amplifier design. The amplifier technology developed so far will be expanded to
    provide a design of a pulsed amplifier operating at the higher output level first.
    The second crucial part of this proposal is to establish a design baseline for pulsed
    power switches with power output capabilities at 300 watts at a max of 20&#37; duty
    cycle.",nt"license_title": "U.S. Government Work",nt"extras": [{ntt"key":
